INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1001, 2, 1, 1, 1.4, "春咲 ひより", "お！\nあそこに困ってそうな人発見！", 0, 1, 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1002, 2, 1, 1, 1.4, "草野 優衣", "大切な人を\n守れるようになりたい…って", 0, 1, 0, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1003, 2, 1, 1, 1.4, "士条 怜", "キミに必要な集中力と感性が", 0, 1, 0, 0, "フェンシングを始めてみては？", 0, "少しは磨かれると思いますよ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1004, 2, 1, 1, 1.5, "穂高 みそぎ", "今日はなにして遊ぶ？", 0, 1, 0, 0, "ねぇ、にいちゃん！", 0, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1006, 2, 1, 1, 1.4, "風宮 あかり", "ねぇ…", 0, 1, 0, 0, "風宮あかりです", 0, "私といっしょに…\nいかない？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1007, 2, 1, 1, 1.5, "出雲 宮子", "プリンたべたいのー", 0, 1, 0, 0, "出雲宮子なのー", 0, "食べ物の恨みは怖いのー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1008, 2, 1, 1, 1.4, "虹村 雪", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 0, 0, "ボクは虹村雪。", 0, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1009, 2, 1, 1, 1.4, "柊杏奈", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 0, 0, "フッ…聞いて後悔するがいい！", 0, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1010, 2, 1, 1, 1.5, "姫宮 真歩", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "ほんまおおきにやわ～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1011, 2, 1, 1, 1.4, "衣之咲 璃乃", "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 0, 0, "衣之咲璃乃です！", 0, "ここで会ったが\n100年目～！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1012, 2, 1, 1, 1.4, "柏崎 初音", "ち、超能力って…\n何のことかな～？", 0, 1, 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1016, 2, 1, 1, 1.4, "美波 鈴奈", "一応カリスマ読モJKやってまっす！", 0, 1, 0, 0, "ちょす！\n美波鈴奈だよ～♪", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1017, 2, 1, 1, 1.4, "喜屋武 香織", "東京は遊園地みたいなところさー", 0, 1, 0, 0, "はいたーい。\n喜屋武香織さー。", 0, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1018, 2, 1, 1, 1.4, "支倉 伊緒", "先生って呼ばれるのは\nくすぐったいから", 0, 1, 0, 0, "支倉伊緒です。", 0, "イオちゃんって呼んでね。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1020, 2, 1, 1, 1.5, "茜 ミミ", "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "ミミをおいてかないでぇ～");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1021, 2, 1, 1, 1.5, "栗林 くるみ", "あの……\nふぇ……", 0, 1, 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "ふぇぇぇぇぇん……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1022, 2, 1, 1, 1.4, "風宮 より", "こんな私に貴重な時間を\n割いていただき、", 0, 1, 0, 0, "風宮よりです。\nあああああ！", 0, "なんてありがとうございます！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1023, 2, 1, 1, 1.5, "北条 綾音", "おにいちゃんどこいくの？\nえ？", 0, 1, 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1025, 2, 1, 1, 1.4, "天野 すずめ", "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 0, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1027, 2, 1, 1, 1.4, "倉石 恵理子", "あなたは…運命の……\n伴侶……", 0, 1, 0, 0, "……クスクス…私は\n…倉石恵理子……", 0, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1028, 2, 1, 1, 1.4, "佐々木 咲恋", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "…そうでしょ？？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1029, 2, 1, 1, 1.4, "桜井 望", "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 0, 0, "桜井望だよ！\nよろしくねっ", 0, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1030, 2, 1, 1, 1.4, "ニノン・ジュベール", "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 0, 0, "デケデケデンっ！", 0, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1031, 2, 1, 1, 1.4, "上喜 しのぶ", "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 0, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, "おかしいですね……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1033, 2, 1, 1, 1.5, "野戸まひる", "けんども\nそれには足りないモンが…", 0, 1, 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1034, 2, 1, 1, 1.4, "綾瀬 ゆかり", "ちょっと緊張しちゃって…", 0, 1, 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1036, 2, 1, 1, 1.5, "氷川 鏡華", "知らない人とは話しちゃいけないので", 0, 1, 0, 0, "氷川鏡華…です", 0, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1038, 2, 1, 1, 1.4, "柏崎 栞", "……あ、アラーム。", 0, 1, 0, 0, "柏崎…栞です。", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1040, 2, 1, 1, 1.4, "双葉 碧", "私、一人も友達がいなくて……", 0, 1, 0, 0, "ふ、双葉碧です。", 0, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1042, 2, 1, 1, 1.4, "三角 千歌", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 0, 0, "三角千歌です。", 0, "そう思っています。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1043, 2, 1, 1, 1.4, "安芸 真琴", "あぁ？\nお前のそいつの仲間か？", 0, 1, 0, 0, "安芸真琴だ。", 0, "う、疑ってすまなかったな…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1044, 2, 1, 1, 1.4, "イリヤ・オーンスタイン", "生けとし生ける全ての者よ！", 0, 1, 0, 0, "わらわこそは夜を総べる者！", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1045, 2, 1, 1, 1.4, "遠見 空花", "ぐふふふふ……はっ！", 0, 1, 0, 0, "そこで騎士は妖精を乱暴に……", 0, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1046, 2, 1, 1, 1.4, "宮坂たまき", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1048, 2, 1, 1, 1.4, "大神 美冬", "それでは早速クエストに…", 0, 1, 0, 0, "大神美冬よ！", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1049, 2, 1, 1, 1.4, "星野静流", "クエストもバトルも\n掃除も洗濯も", 0, 1, 0, 0, "星野静流だよ！", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1050, 2, 1, 1, 1.5, "玉泉美咲", "見ての通りの\nセクシー美少女で", 0, 1, 0, 0, "アタシは玉泉美咲。", 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1052, 2, 1, 1, 1.4, "リマ", "？？？？", 0, 1, 0, 0, "？？？", 0, "？？？？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1053, 2, 1, 1, 1.5, "モニカ・ヴァイスヴィント", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1058, 2, 1, 1, 1.5, "ペコリーヌ", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1059, 2, 1, 1, 1.5, "コッコロ", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (0, 1060, 2, 1, 1, 1.5, "キャル", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる");
